// Calculate Final Galaxy Conquest Score
const calculateFinalConquestScore = () => {
  const portalStability = Object.values(galaxyPortalStabilizer.portal_network)
    .reduce((sum, portal) => sum + portal.stability_rating, 0) / 5;

  const mechanismStability = Object.values(galaxyPortalStabilizer.stabilization_mechanisms)
    .reduce((sum, mechanism) => {
      const stability = mechanism.decoherence_resistance || mechanism.stability_contribution || 
                       mechanism.matrix_control_level || mechanism.circulation_efficiency || 0.95;
      return sum + stability;
    }, 0) / 4;

  const baseScore = 99.8;
  const finalScore = (baseScore + portalStability + mechanismStability) / 3 * 100;

  return Math.min(finalScore, 99.9);
};

